package test;

import java.util.Comparator;
import java.util.List;
import java.util.Map;
import java.util.stream.Collectors;

/**
 * This is a hacker rank problem
 * @author Danuka
 *
 */
public class SherlockAndValidStrings {

	/**
	 * A string is valid if its characters occur the same number of times. It is also valid if one deletion 
	 * could make the occurrence of characters equal.
	 * eg: abaabcbcc is valid as each character repeats 3 times. {a:3, b:3, c:3}
	 * eg: aaabcc is invalid as characters don't appear equal number of times. {a:3, b:1 ,c:2}
	 * eg: aabbccc is valid as deleting one c can make each character appear equal number of times. {a:2, b:2, c:2}
	 * 
	 * @param s
	 * @return "YES" if the string is valid, "NO" otherwise.
	 */
	static String isValid(String s) {
		
		Map<Integer, List<Integer>> map = s.chars().boxed().collect(Collectors.groupingBy(i -> i));
		
		List<Integer> occurances = map.values().stream().map(lst -> lst.size()).collect(Collectors.toList());
		Integer minOccurance = occurances.stream().min(Comparator.comparing(Integer::intValue)).get();
		Integer maxOccurance = occurances.stream().max(Comparator.comparing(Integer::intValue)).get();
		
		int minCount = (int) occurances.stream().filter(o -> o.equals(minOccurance)).count();
		int maxCount = (int) occurances.stream().filter(o -> o.equals(maxOccurance)).count();

		if (occurances.size() < 2) {
			return "YES";
		} else if (minOccurance.equals(maxOccurance)) {
			return "YES";
		} else if ((maxOccurance - minOccurance != 1) &&  minCount != 1) {
			return "NO";
		} else if ((minCount + maxCount == occurances.size()) && minCount == 1 ) {
			return "YES";
		} else {
			return "NO";
		}
		
    }
	
	public static void main(String[] args) {
		System.out.println(isValid(""));
	}
}
